  "entities" : {
    "user_mentions" : [ ],
    "media" : [ ],
    "hashtags" : [ ],
    "urls" : [ ]
  },
  "geo" : { },
  "id_str" : "588960399384387584",
  "text" : "The bunny leaps back onto his head and they head out of the office, nodding to the guard on the way out.",
