  "entities" : {
    "user_mentions" : [ ],
    "media" : [ ],
    "hashtags" : [ ],
    "urls" : [ ]
  },
  "geo" : { },
  "id_str" : "588952616412979200",
  "text" : "He shrugs and takes a seat, causing Purity to jump off onto the table onto a stack of papers, acting as a living paperweight. \"Sometime.\"",
  "id" : 588952616412979200,
  "created_at" : "2015-04-17 06:30:20 +0000",
