  "entities" : {
    "user_mentions" : [ ],
    "media" : [ ],
    "hashtags" : [ ],
    "urls" : [ ]
  },
  "geo" : { },
  "id_str" : "587106846520909824",
  "text" : "He turns back toward it, stepping on it again. \"Uh, were the floorboards always this squeaky?\"",
