  "entities" : {
    "user_mentions" : [ ],
    "media" : [ ],
    "hashtags" : [ ],
    "urls" : [ ]
  },
  "geo" : { },
  "id_str" : "583430692001845248",
  "text" : "He turns to her briefly. \"Don't you think I'd be a tiny bit suspicious of what's inside there myself given what today is, @mlp_RoseLight?\"",
  "id" : 583430692001845248,
  "created_at" : "2015-04-02 00:48:11 +0000",
