  "entities" : {
    "user_mentions" : [ ],
    "media" : [ ],
    "hashtags" : [ ],
    "urls" : [ ]
  },
  "geo" : { },
  "id_str" : "583341249878368256",
  "text" : "\"... what really is the point of pranking ponies, anyway, @mlp_LuciaV. It's not like today is really special or anything.\"",
  "id" : 583341249878368256,
  "created_at" : "2015-04-01 18:52:46 +0000",
